---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: agent-prod-secrets
  namespace: mongodb
spec:
  encryptedData:
    MONGODB_DATABASE: 
    MONGODB_HOST: 
    MONGODB_PORT: 
    MONGODB_URL: 
    MONGODB_USER: 
    password: 
  template:
    metadata:
      annotations:
        argocd.argoproj.io/sync-wave: "0"
        reflector.v1.k8s.emberstack.com/reflection-allowed: "true"
        reflector.v1.k8s.emberstack.com/reflection-allowed-namespaces: agent-prod
        reflector.v1.k8s.emberstack.com/reflection-auto-enabled: "true"
      name: agent-prod-secrets
      namespace: mongodb
    type: Opaque
